ListNode:
/**
 * Definition for singly-linked list.
 * function ListNode(x) {
 *	 this.val = x;
 *	 this.next;
 * }
 */

Point:
/**
 * Definition for a point.
 * function Point(x,y) {
 *	 this.x = x;
 *	 this.y = y;
 * }
 */

TreeNode:
/**
 * Definition for binary tree.
 * function TreeNode(x) {
 *	 this.val = x;
 *	 this.left;
 *	 this.right;
 * }
 */
